const initialState = {
    name:'mememe',
    age:27,
    password:'metoo'
};


const rootReducer = (( state = initialState, action)=>{
    switch(action.type){
        case 'CHANGE_NICKNAME':
            return{
                ...state,
                name: action.data,
            }
    }
});

export default rootReducer;
